import React from "react";
import { Form, Button, Container, Row, Col } from "react-bootstrap";

const TripForm = ({ onSubmit }) => {
  // Remove the state variables and set static variables:
  const startLocation = "123 Main St, Anytown, USA";
  const pickupLocation = "O'Hare Airport, Chicago, IL";
  const dropoffLocation = "Long Beach Port, CA";
  const currentCycleHours = 68.5;
  const startDate = "2024-01-10";

  const handleSubmit = (event) => {
    event.preventDefault();
    onSubmit({
      startLocation,
      pickupLocation,
      dropoffLocation,
      currentCycleHours,
      startDate,
    });
  };

  return (
    <Container className = "mx-auto" style = {{width: '500px'}}>
      <h2>Enter Trip Details</h2>
      <Form onSubmit={handleSubmit}>
        <Form.Group as={Row} className="mb-3">
          <Form.Label column sm={4} style = {{fontSize: '1.2em'}}>
            Start Location:
          </Form.Label>
          <Col sm={8}>
            <Form.Control
              type="text"
              placeholder="Enter start location"
              value={startLocation}
              readOnly // Add this prop
              style = {{fontSize: '1.2em'}}
            />
          </Col>
        </Form.Group>

        <Form.Group as={Row} className="mb-3">
          <Form.Label column sm={4} style = {{fontSize: '1.2em'}}>
            Pickup Location:
          </Form.Label>
          <Col sm={8}>
            <Form.Control
              type="text"
              placeholder="Enter pickup location"
              value={pickupLocation}
              readOnly // Add this prop
              style = {{fontSize: '1.2em'}}
            />
          </Col>
        </Form.Group>

        <Form.Group as={Row} className="mb-3">
          <Form.Label column sm={4} style = {{fontSize: '1.2em'}}>
            Dropoff Location:
          </Form.Label>
          <Col sm={8}>
            <Form.Control
              type="text"
              placeholder="Enter dropoff location"
              value={dropoffLocation}
              readOnly // Add this prop
               style = {{fontSize: '1.2em'}}
            />
          </Col>
        </Form.Group>

        <Form.Group as={Row} className="mb-3">
          <Form.Label column sm={4} style = {{fontSize: '1.2em'}}>
            Current Cycle Hours:
          </Form.Label>
          <Col sm={8}>
            <Form.Control
              type="number"
              placeholder="Enter current cycle hours"
              value={currentCycleHours}
              readOnly // Add this prop
               style = {{fontSize: '1.2em'}}
            />
          </Col>
        </Form.Group>

        <Form.Group as={Row} className="mb-3">
          <Form.Label column sm={4} style = {{fontSize: '1.2em'}}>
            Start Date:
          </Form.Label>
          <Col sm={8}>
            <Form.Control
              type="date"
              placeholder="Enter start date"
              value={startDate}
              readOnly // Add this prop
               style = {{fontSize: '1.2em'}}
            />
          </Col>
        </Form.Group>

        <Button variant="primary" type="submit" style = {{fontSize: '1.2em'}}>
          Generate Logs
        </Button>
      </Form>
    </Container>
  );
};

export default TripForm;
